import React, { Component } from 'react';

class Disclosures extends Component {
  render() {
    return (
      <p className="disclosures">
        <a href="#main-certifications-disclosures">
          Analyst certifications and Important Disclosures
        </a>
      </p>
    );
  }
}

export default Disclosures;
